import {
  AppBar,
  Box,
  Button,
  IconButton,
  Toolbar,
  Typography,
} from "@mui/material";

const Header = () => {
  return (
    <Toolbar
      variant="dense"
      sx={{ p: 0, minHeight: "auto", py: "8px", backgroundColor: "#c6cffb" }}
    >
      <Box mx={4}>
        <IconButton></IconButton>
      </Box>
      <Box mx={3}>
        <Typography sx={{ color: "white", fontWeight: "bold" }}>
          견적비교
        </Typography>
      </Box>
      <Box mx={3}>
        <Typography sx={{ color: "white", fontWeight: "bold" }}>
          핸드캐리
        </Typography>
      </Box>
      <Box mx={3}>
        <Typography sx={{ color: "white", fontWeight: "bold" }}>
          마이페이지
        </Typography>
      </Box>
      <Box sx={{ flexGrow: 1 }}></Box>
      {/* 버튼을 오른쪽으로 배치하기 위한 코드 */}
      <Box>
        <Button
          sx={{
            backgroundColor: "#11ac0a",
            color: "white",
            borderRadius: 5,
            ":hover": { backgroundColor: "#11ac0a" },
            textTransform: "none",
            whiteSpace: "nowrap",
          }}
        >
          Log In / Sign Up{" "}
        </Button>
      </Box>
    </Toolbar>
  );
};

export default Header;
